import React from 'react';

const styles = {
  ImageContainer: {
    top: '0px',
    left: '0px',
    width: '1440px',
    height: '787px',
    backgroundImage: 'url(./image.png)',
    backgroundPosition: 'center center',
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
  },
};

const defaultProps = {
  image: 'https://assets.api.uizard.io/api/cdn/stream/53adf045-6696-4aca-9acd-e6abec8b6cd1.png',
}

export default function ImagemBkGround(props) {
  return (
    <div style={{
      ...styles.ImageContainer,
      backgroundImage: `url(${props.image ?? defaultProps.image})`,
    }} />
  );
};
